type Distance struct {
	data [][]float64
}

type Position struct {
	Lat       float64 `json:"lat"`
	Lng       float64 `json:"lng"`
	Elevation float64 `json:"elevation"`
}

type PositionMark struct {
	Mark      float64
	Positions Position
}

type DataBlob struct {
	D Distance       `json:"distance"`
	P []PositionMark `json:"position"`
}

var JData *DataBlob

func init() {
	JData = new(DataBlob)
	var tmp interface{}
	json.Unmarshal(datas, &tmp)
	tmp1 := tmp.(map[string]interface{})
	dist := tmp1["distance"].([]interface{})

	var Ds Distance
	for _, d := range dist {
		dd := d.([]interface{})
		f1 := dd[0].(float64)
		f2 := dd[1].(float64)
		Ds.data = append(Ds.data, []float64{f1, f2})
	}
	JData.D = Ds

	poss := tmp1["position"].([]interface{})
	Poses := make([]PositionMark, 0)
	for _, d := range poss {
		dd := d.([]interface{})
		f1 := dd[0].(float64)
		f2 := dd[1].(map[string]interface{})
		pm := PositionMark{
			Mark: f1,
			Positions: Position{
				Lat:       f2["lat"].(float64),
				Lng:       f2["lng"].(float64),
				Elevation: f2["elevation"].(float64),
			},
		}
		Poses = append(Poses, pm)
	}
	JData.P = Poses
	//pos := tmp1["position"]
	fmt.Println(len(Poses))
	fmt.Println(len(Ds.data))
}

func main() {

	mul := 1000000.0
	t0 := int64(1)
	opts := series.NewOptions(2, false)

	runs := 1
	gorCompTime := int64(0)
	snapCompTime := int64(0)
	zstdCompTime := int64(0)
	zlibCompTime := int64(0)

	fmt.Println(len(JData.D.data)*2 + len(JData.P)*4)
	for i := 0; i < runs; i++ {
		tick := time.Now().UnixNano()
		ts, _ := series.NewTimeSeries("gorilla", t0, opts)
		for _, d := range JData.D.data {
			t0++
			t := float64(int64(d[0] * mul))
			f1 := float64(int64(d[1] * mul))
			//fmt.Println(d[0], int64(d[0] * 10000000000))
			ts.AddPoint(t0, t, f1, 0, 0, 2) // 2 to avoid "smart" encoding
		}

		opts.NumValues = 5
		t0 = 1
		tspos, _ := series.NewTimeSeries("gorilla", t0, opts)
		for _, d := range JData.P {
			t0++
			t := float64(int64(d.Mark * mul))
			lat := float64(int64(d.Positions.Lat * mul))
			lng := float64(int64(d.Positions.Lng * mul))
			ele := float64(int64(d.Positions.Elevation * mul))
			//fmt.Println(d[0], int64(d[0] * 10000000000))
			//AddPoint(t int64, min float64, max float64, last float64, sum float64, count int64) error {
			tspos.AddPoint(t0, t, lat, lng, ele, 2) // 2 to avoid "smart" encoding
		}
		gorCompTime += (time.Now().UnixNano() - tick)

		tByts, _ := ts.MarshalBinary()
		tpByts, _ := tspos.MarshalBinary()
		fullLen := len(tByts) + len(tpByts)
		fmt.Println("Orig: ", len(datas))
		fmt.Println("Gorrilla Compressed: ", fullLen)
		fmt.Println("Gorrilla %: ", (1.0-(float64(fullLen)/float64(len(datas))))*100.0)

		tick = time.Now().UnixNano()

		c_bss := snappy.Encode(nil, datas)
		fmt.Println("Snappy Compressed: ", len(c_bss))
		fmt.Println("Snappy %: ", (1.0-(float64(len(c_bss))/float64(len(datas))))*100.0)

		snapCompTime += (time.Now().UnixNano() - tick)

		tick = time.Now().UnixNano()

		z_bss := new(bytes.Buffer)
		zipper := zstd.NewWriter(z_bss)
		zipper.Write(datas)
		zipper.Close()
		c_bss = z_bss.Bytes()
		fmt.Println("ZStd Compressed: ", len(c_bss))
		fmt.Println("ZStd %: ", (1.0-(float64(len(c_bss))/float64(len(datas))))*100.0)
		zstdCompTime += (time.Now().UnixNano() - tick)

		tick = time.Now().UnixNano()

		zz_bss := new(bytes.Buffer)
		zzipper := zlib.NewWriter(zz_bss)
		zzipper.Write(datas)
		zzipper.Flush()
		c_bss = zz_bss.Bytes()

		fmt.Println("Zlib Compressed: ", len(c_bss))
		fmt.Println("Zlib %: ", (1.0-(float64(len(c_bss))/float64(len(datas))))*100.0)
		zlibCompTime += (time.Now().UnixNano() - tick)
	}

	fmt.Println("Gorilla Comp Time: ", float64(gorCompTime)/float64(runs)/float64(time.Second))
	fmt.Println("Snappy Comp Time: ", float64(snapCompTime)/float64(runs)/float64(time.Second))
	fmt.Println("ZSTD Comp Time: ", float64(zstdCompTime)/float64(runs)/float64(time.Second))
	fmt.Println("Zlib Comp Time: ", float64(zlibCompTime)/float64(runs)/float64(time.Second))

}
